configure:
  commands:
    end:
      new_state: execute
    line console:
      new_state: configure_line
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: Intrepid-DUT-1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
    line vty: ''
    terminal width 511: ''
  prompt: Intrepid-DUT-1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
